import Filter from "./Filter"

const Filters = (props) => {

props.filters.map(filter => {console.log(filter)})

return (
    <div>
    <h2>FILTERS</h2>
    {props.filters.map((filter) => (
          <>
          <Filter
            label={filter.label}
          />
          </>
        ))}
    </div>
)

}

export default Filters;
